-- Create foreign key
--
ALTER TABLE class
ADD CONSTRAINT FK_class_CourseID FOREIGN KEY (CourseID)
REFERENCES course (CourseID) ON DELETE CASCADE ON UPDATE CASCADE;

--
-- Create foreign key
--
ALTER TABLE class
ADD CONSTRAINT FK_class_MajorsID FOREIGN KEY (MajorsID)
REFERENCES majors (MajorsID) ON DELETE CASCADE ON UPDATE CASCADE;

DELIMITER $$

--
-- Create procedure `Proc_Updateclass`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Updateclass (IN ClassId char(36), IN ClassCode varchar(20), IN ClassName varchar(255), IN CourseID char(36), IN MajorsID char(36))
BEGIN
  UPDATE class c
  SET c.ClassCode = ClassCode,
      c.ClassName = ClassName,
      c.MajorsID = MajorsID,
      c.CourseID = CourseID,
      c.CreatedDate = NOW(),
      c.ModifiedDate = NOW()
  WHERE c.ClassID = ClassId;
END
$$

--
-- Create procedure `Proc_Insertclass`
--
CREATE PROCEDURE Proc_Insertclass (IN ClassCode varchar(20), IN ClassName varchar(255), IN CourseID char(36), IN MajorsID char(36), IN MajorsCode varchar(20))
SQL SECURITY INVOKER
BEGIN
  DECLARE ID char(36);
  IF (MajorsCode IS NOT NULL) THEN
    SET ID = (SELECT
        m.MajorsID
      FROM majors m
      WHERE m.MajorsCode = MajorsCode);
    INSERT INTO class (ClassID, ClassCode, ClassName, MajorsID, CourseID, CreatedDate, ModifiedDate)
      VALUES (UUID(), ClassCode, ClassName, ID, CourseID, NOW(), NOW());
  ELSEIF MajorsCode IS NULL THEN
    INSERT INTO class (ClassID, ClassCode, ClassName, MajorsID, CourseID, CreatedDate, ModifiedDate)
      VALUES (UUID(), ClassCode, ClassName, MajorsID, CourseID, NOW(), NOW());
  END IF;
END
$$

--
-- Create procedure `Proc_Getclasss`
--
CREATE PROCEDURE Proc_Getclasss ()
SQL SECURITY INVOKER
BEGIN
  SELECT
    c.ClassID,
    c.ClassCode,
    c.ClassName,
    c.CourseID,
    c.MajorsID,
    c.CreatedDate,
    c.ModifiedDate,
    m.MajorsName,
    c1.CourseName
  FROM class c
    LEFT JOIN majors m
      ON c.MajorsID = m.MajorsID
    LEFT JOIN course c1
      ON c.CourseID = c1.CourseID
  ORDER BY c.CreatedDate DESC;
END
$$

