--
-- Create procedure `Proc_Insertstudent`
--
CREATE PROCEDURE Proc_Insertstudent (IN StudentCode varchar(20), IN FullName varchar(255), IN DateOfBirth date, IN Gender int, IN ClassID char(36), IN ClassCode varchar(20))
SQL SECURITY INVOKER
BEGIN
  DECLARE ID char(36);
  IF ClassCode IS NOT NULL THEN
    SET ID = (SELECT
        c.ClassID
      FROM class c
      WHERE c.ClassCode = ClassCode);
    INSERT INTO student (StudentID, StudentCode, FullName, DateOfBirth, Gender, ClassID, CreatedDate, ModifiedDate)
      VALUES (UUID(), StudentCode, FullName, DateOfBirth, Gender, ID, NOW(), NOW());
  ELSEIF ClassCode IS NULL THEN
    INSERT INTO student (StudentID, StudentCode, FullName, DateOfBirth, Gender, ClassID, CreatedDate, ModifiedDate)
      VALUES (UUID(), StudentCode, FullName, DateOfBirth, Gender, ClassID, NOW(), NOW());
  END IF;

END
$$

